import React from "react";
import axios from "axios";

export default function Intro() {
  const getTours = () => {
    axios
      .get("http://localhost:8000/api/tour/get-all-tour")
      .then((res) => {
        console.log(res);
        return res;
      })
      .catch((err) => {
        console.log(err);
      });
  };
  getTours();
  return (
    <div>
      <h1>Đẹp trai lỗi tại </h1>
    </div>
  );
}
